<!doctype html><html lang="es"><head><meta charset="UTF-8"><meta http-equiv="X-UA-Compatible" content="IE=edge"><meta name="viewport" content="width=device-width,initial-scale=1"><title>Advanced React</title><link rel="apple-touch-icon" href="./src/assets/icon.png"><script defer="defer" src="/app.bundle.js"></script><meta name="theme-color" content="#b1a" /><link rel="manifest" href="/manifest.99f0fae286fd3430b3b34a63a35735cd.json" /></head><body><div id="app"></div><noscript><h3>Esta app necesita Javascript para funcionar</h3></noscript><script>if('serviceWorker' in navigator) {
				window.addEventListener('load', () => {
					navigator.serviceWorker.register('/service-worker.js')

							console.log('SW registrado')
						})
						.catch(err => console.log('sw error', err))
				})
		}</script></body></html>
